class Solution():
    def maxArea(self, height):
        if isinstance(height, list):
            c_max = 0
            for i in range(len(height)):
                __k_max = 0
                __k_index = 0
                for k in range(i + 1, len(height)):
                    try:
                        if height[k] > __k_max:
                            __k_max = height[k]
                            __k_index = k
                    except TypeError:
                        return TypeError

                for k2 in range(__k_index, len(height)):
                    try:
                        if height[i] >= height[k2]:
                            c = height[k2] * (k2 - i)
                        else:
                            c = height[i] * (k2 - i)
                        if c > c_max:
                            c_max = c
                    except TypeError:
                        return TypeError
            return c_max
        else:
            return TypeError

